void generate_charge(int n, double pos_x[], double pos_y[], int q[]) {/// n 
    K = n;
    for (int i = 0; i < n; i++) {
        pos_x[i] = a + (b - a + 1) * rand() / (double)(RAND_MAX + 1);
        pos_y[i] = a + (b - a + 1) * rand() / (double)(RAND_MAX + 1);
        q[i] = MINQ + rand() % (MAXQ - MINQ + 1);
    }
}

