void transformation1(double Matrix[][128], float data[], float trans_data[]) {

    float res;
    int j;
    for (int i = 0; i < MAXL; i++) {
        res = 0.0;
        for (j = 0; j < MAXL; j++) {
            res += Matrix[i][j] * data[j];
        }
        trans_data[i] = res * 320;
    }
}

